DEAD = " ";
LIVE = "X";
width = 40;
height = 40;

var alive_count = 0;
var min_neigh = 2;
var max_neigh = 3; /*noninclusive*/
var rebirth_neigh = 3; /*exact amount to be born*/

var cur = 1;
var next = 0;

var reset = false;

iterations = 0;

function life(grid) {
    if (iterations === 0) {
        var start = 1;
        for (var i = 0; i < height; i++) {
            for (var j = 0; j < width; j++) {
                if (grid[0][i][j] === LIVE) {
                    document.getElementById(start.toString()).style.backgroundColor = "#00ff00"
                } else {
                    document.getElementById(start.toString()).style.backgroundColor = "#0f99e3"
                }
                start++
            }
        }
    } else {
        var div = 1;
        if (stop !== true) {
            cur = (cur + 1) % 2;
            next = (next + 1) % 2;
            for (var y = 0; y < height; y++) {
                for (var x = 0; x < width; x++) {
                    alive_count = 0;
                    //console.log(x)
                    /*check surrounding cells*/
                    if (x !== 0 && grid[cur][y][x - 1] === LIVE) {  /*<*/
                        alive_count++;
                    }
                    if (x !== width - 1 && grid[cur][y][x + 1] === LIVE) {  /*>*/

                        alive_count++;
                    }
                    if (y !== 0 && grid[cur][y - 1][x] === LIVE) {  /*^*/

                        alive_count++;
                    }
                    if (y !== height - 1 && grid[cur][y + 1][x] === LIVE) { /*v*/

                        alive_count++;
                    }

                    if ((x !== 0 && y !== 0) && grid[cur][y - 1][x - 1] === LIVE) {  /*\^*/

                        alive_count++;
                    }

                    if ((x !== width - 1 && y !== 0) && grid[cur][y - 1][x + 1] === LIVE) {  /*/^*/

                        alive_count++;
                    }

                    if ((x !== 0 && y !== height - 1) && grid[cur][y + 1][x - 1] === LIVE) {  /*/v*/

                        alive_count++;
                    }

                    if ((x !== width - 1 && y !== height - 1) && grid[cur][y + 1][x + 1] === LIVE) {  /*\v*/

                        alive_count++;
                    }
                    /*********************************/

                    // console.log(alive_count)
                    /*check if cell should be DEAD or ALIVE*/
                    if (grid[cur][y][x] === LIVE) {
                        if (alive_count < min_neigh || alive_count > max_neigh) {
                            grid[next][y][x] = DEAD;
                        } else {
                            grid[next][y][x] = grid[cur][y][x];
                        }
                    } else if (grid[cur][y][x] === DEAD && alive_count === rebirth_neigh) {
                        grid[next][y][x] = LIVE;

                    } else {
                        grid[next][y][x] = grid[cur][y][x];
                    }
                    if (grid[next][y][x] === LIVE) {
                        document.getElementById((div.toString())).style.backgroundColor = "#00ff00"
                        console.log(div, "live")

                    } else if (grid[next][y][x] === DEAD) {
                        document.getElementById((div.toString())).style.backgroundColor = "#0f99e3"
                        console.log(div, "dead")
                    }
                    div++;
                }
                console.count(grid[next][y]);
            }
        }
    }
    setTimeout(function () {
        if (reset === false) {
            iterations++;
            life(grid)
        } else {
            return "stopped"
        }
    }, 500);
}

